import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { IndexComponent } from './System/index1/index.component';
import { TDPComponent } from './System/tdp/tdp.component';
import { TepComponent } from './System/tep/tep.component';
import { TLPComponent } from './System/tlp/tlp.component';
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';

@NgModule({
  declarations: [
    AppComponent,
    IndexComponent,
    TLPComponent,
    TDPComponent,
    TepComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
